import {Link} from 'react-router-dom';
import React, {useState, useEffect} from 'react';

export default function Form(){
    const [form, setForm] = useState([]);
    useEffect(()=>{
        fetch('/form/api').then((result)=>result.json()).then((json)=>{
            console.log({json});
            setForm(json);
        }).catch(console.log);
    }, []);

    return (<div>
    <div class="container">
    <div class="row justify-content-center">
        <div class="col-6">
            <form action="/movements/api" method="post">
                <div class="form-group">
                    <label for="concept">Concept:</label>
                    <input type="text" name="concept" id="concept" class="form-control"/>
                </div>
                <div class="form-group">
                    <label for="amount">Amount:</label>
                        <div class="input-group-prepend">
                            <span class="input-group-text">$</span>
                            <input type="number" name="amount" id="amount" class="form-control"/>
                        </div>
                </div>
                <div class="form-group">
                    <label for="date">Date:</label>
                    <input type="date" name="date" id="date" class="form-control"/>
                </div>
                <div class="form-group">
                    <label for="type">Type:</label>
                    <select class="form-control" id="type" name="type">
                        <option>Income</option>
                        <option>Expense</option>
                    </select>
                </div>
                <button type="submit" class="btn btn-primary btn-block" onClick={()=>{
                }}>Aceptar</button>
            </form>
        </div>
    </div>
</div>
</div>)};
